import React from 'react';
import styled from 'styled-components';
const Button = (props) => {
  const CustomCard = styled.div`
    border-radius: 5px;
    box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
    width: 200px;
    padding: 16px;
  `;
  return (
    <CustomCard>
      <button type={props.type} onClick={props.onClick}>
        {props.children}
      </button>
    </CustomCard>
  );
};

export default Button;
